import React, { useState, useRef, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';

const Header = ({ showSearch = true }) => {
  const location = useLocation();
  const navigate = useNavigate();
  const [showUserMenu, setShowUserMenu] = useState(false);
  const userMenuRef = useRef(null);

  useEffect(() => {
    function handleClickOutside(event) {
      if (userMenuRef.current && !userMenuRef.current.contains(event.target)) {
        setShowUserMenu(false);
      }
    }
    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  const handleLogoClick = () => {
    navigate('/');
  };

  const handleUserClick = () => {
    setShowUserMenu((prev) => !prev);
  };

  const handleEditarPerfil = () => {
    setShowUserMenu(false);
    navigate('/perfil');
  };

  // Links padrão para todas as páginas
  const links = [
    { to: '/', label: 'Dashboard' },
    { to: '/minhas-tarefas', label: 'Minhas Tarefas' },
    { to: '/categorias', label: 'Categorias' },
    { to: '/usuarios', label: 'Usuários' }
  ];

  return (
    <header className="flex items-center justify-between whitespace-nowrap border-b border-solid border-b-[#e7edf4] px-10 py-3">
      <div className="flex items-center gap-4 text-[#0d141c] cursor-pointer" onClick={handleLogoClick} title="Ir para o início">
        <div className="size-4">
          <svg viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M6 6H42L36 24L42 42H6L12 24L6 6Z" fill="currentColor"></path>
          </svg>
        </div>
        <h2 className="text-[#0d141c] text-lg font-bold leading-tight tracking-[-0.015em] select-none">TaskMaster</h2>
      </div>
      <div className="flex flex-1 justify-end gap-8 items-center">
        <div className="flex items-center gap-9">
          {links.map((link) => (
            <Link
              key={link.to}
              className={`text-[#0d141c] text-sm font-medium leading-normal ${location.pathname === link.to ? 'font-bold underline underline-offset-4' : ''}`}
              to={link.to}
            >
              {link.label}
            </Link>
          ))}
        </div>
        {showSearch && (
          <label className="flex flex-col min-w-40 !h-10 max-w-64">
            <div className="flex w-full flex-1 items-stretch rounded-lg h-full">
              <div className="text-[#49739c] flex border-none bg-[#e7edf4] items-center justify-center pl-4 rounded-l-lg border-r-0">
                <svg xmlns="http://www.w3.org/2000/svg" width="24px" height="24px" fill="currentColor" viewBox="0 0 256 256">
                  <path d="M229.66,218.34l-50.07-50.06a88.11,88.11,0,1,0-11.31,11.31l50.06,50.07a8,8,0,0,0,11.32-11.32ZM40,112a72,72,0,1,1,72,72A72.08,72.08,0,0,1,40,112Z"></path>
                </svg>
              </div>
              <input
                placeholder="Pesquisar"
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-full placeholder:text-[#49739c] px-4 rounded-l-none border-l-0 pl-2 text-base font-normal leading-normal"
              />
            </div>
          </label>
        )}
        <div className="relative">
          <div
            className="bg-center bg-no-repeat aspect-square bg-cover rounded-full size-10 cursor-pointer border-2 border-transparent hover:border-[#0c7ff2] transition-all"
            style={{ backgroundImage: 'url("https://lh3.googleusercontent.com/aida-public/AB6AXuDG8rRYKso9v61-lxDXSu1ySOQmPsqfX1oEZam5b8LX0PFwyO0C_K9NH1O_BmH33L0AtKGUY2Stt7WiGERTqMpjQkwMVJw6S0B0rexFIQ93TOPSIRybOSDCjbDRRgRJnSNUuvUhQ44QJePlcrlNQUm7BCHHpfwq75E0Ka4HhBv_dsVFpPZvsVRPJoeW9QwDtHxDWXK4lV4GL5HqtKaN4WZXrhvX4pXvogoktXvQNWF27hlYUN8JrJtE7woW_pbWQ363KNsRwUCIXBE")' }}
            onClick={handleUserClick}
            title="Perfil do usuário"
          ></div>
          {showUserMenu && (
            <div ref={userMenuRef} className="absolute right-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-[#e7edf4] z-50">
              <button
                onClick={handleEditarPerfil}
                className="w-full text-left px-4 py-2 text-[#0d141c] hover:bg-[#f1f5f9] rounded-t-lg"
              >
                Editar Perfil
              </button>
              <button
                onClick={() => setShowUserMenu(false)}
                className="w-full text-left px-4 py-2 text-[#dc2626] hover:bg-[#f1f5f9] rounded-b-lg"
              >
                Fechar
              </button>
            </div>
          )}
        </div>
      </div>
    </header>
  );
};

export default Header;
